import{_ as e,o as t,c as s,Q as o}from"./chunks/framework.e5ba4c7f.js";const f=JSON.parse('{"title":"Mobile Users","description":"","frontmatter":{},"headers":[],"relativePath":"tabs-and-screens/mobile-users.md","filePath":"tabs-and-screens/mobile-users.md"}'),r={name:"tabs-and-screens/mobile-users.md"},a=o('<h1 id="mobile-users" tabindex="-1">Mobile Users <a class="header-anchor" href="#mobile-users" aria-label="Permalink to &quot;Mobile Users&quot;">​</a></h1><p>Use the <strong>Mobile Users</strong> tab to view and interact with the list of all mobile users.</p><h2 id="accessibility" tabindex="-1">Accessibility <a class="header-anchor" href="#accessibility" aria-label="Permalink to &quot;Accessibility&quot;">​</a></h2><p>By default, this tab is only accessible by users with the <a href="./../roles.html#administrator">Administrator</a> role.</p><h2 id="on-this-tab" tabindex="-1">On this tab <a class="header-anchor" href="#on-this-tab" aria-label="Permalink to &quot;On this tab&quot;">​</a></h2><ul><li><strong>Mobile Users</strong> table — contains a list of all mobile users. The table contains the following fields: <ul><li><strong>View</strong> — contains the <strong>Details</strong> button for each record. Selecting <strong>Details</strong> opens the <strong>User Info</strong> screen containing the account details of a user.</li><li><strong>Full name</strong> — the first and last name of a user.</li><li><strong>Account ID</strong> — the unique identification number of a user in the <code>username@domain</code> format (e.g., <code>james_mae@auki</code>).</li><li><strong>Phone number</strong> — the phone number of a user.</li><li><strong>Email</strong> — the email address of a user.</li><li><strong>Address</strong> — the actual residential address of a user.</li><li><strong>Registered Date</strong> — the date and time on which a user registered.</li><li><strong>Status</strong> — the KYC status of a user.</li></ul></li><li><strong>KYC Status</strong> dropdown list — choosing an option from the list allows to filter the table records by the KYC status of a user. The list contains the following options: <ul><li><strong>All</strong> — all of the users are shown.</li><li><strong>Full KYC</strong> — only the users with Full KYC are shown.</li><li><strong>Partial KYC</strong> — only the users with Partial KYC are shown.</li></ul></li><li><strong>Export</strong> button — allows to export the contents of the <strong>Mobile Users</strong> table as a <code>.csv</code> file.</li><li><strong>Search</strong> bar — allows to search the contents of the <strong>Mobile Users</strong> table.<br> The bar supports letters, numeric values, and dates in the YYYY-MM-DD format (e.g., 2022-10-31).</li></ul><h2 id="viewing-record-details" tabindex="-1">Viewing record details <a class="header-anchor" href="#viewing-record-details" aria-label="Permalink to &quot;Viewing record details&quot;">​</a></h2><p>To view record details of a particular mobile user, find a record that you are interested in and press the <strong>Details</strong> button next to it.</p><h2 id="exporting-table-contents" tabindex="-1">Exporting table contents <a class="header-anchor" href="#exporting-table-contents" aria-label="Permalink to &quot;Exporting table contents&quot;">​</a></h2><p>To export the contents of the <strong>Mobile Users</strong> table, perform the following steps:</p><ol><li>Select <strong>Export</strong>.<br> The <strong>Export a report</strong> window appears.</li><li>Select <strong>Start Date</strong>.<br> The <strong>Calendar</strong> window appears.</li><li>Scroll through the calendar to find the starting date of the time period that you are interested in and select it (DD/MM/YYYY; e.g., 11/01/2022).<br> The chosen date is input into the <strong>Start Date</strong> field; the <strong>End Date</strong> field is now active.</li><li>Scroll through the calendar to find the ending date of the time period that you are interested in and select it (DD/MM/YYYY; e.g., 11/11/2022).<br> The chosen date is input into the <strong>End Date</strong> field; the <strong>Calendar</strong> window disappears.</li><li>Select <strong>Export CSV</strong>.<br> The resulting <code>.csv</code> file is downloaded to your computer.</li></ol>',11),i=[a];function n(l,h,d,c,g,u){return t(),s("div",null,i)}const p=e(r,[["render",n]]);export{f as __pageData,p as default};
